use std::collections::HashMap;
use std::sync::LazyLock;

/// Lookup map for extended confusions by word
pub static EN_CONFUSION_EXTENDED_LOOKUP: LazyLock<HashMap<&'static str, Vec<&'static ConfusionPair>>> = LazyLock::new(|| {
	let mut map: HashMap<&'static str, Vec<&'static ConfusionPair>> = HashMap::new();
	for pair in EN_CONFUSION_EXTENDED {
		map.entry(pair.word1).or_default().push(pair);
		if pair.bidirectional {
			map.entry(pair.word2).or_default().push(pair);
		}
	}
	map
});

/// Get extended confusions for a word
pub fn get_en_confusion_extended(word: &str) -> Option<&Vec<&'static ConfusionPair>> {
	EN_CONFUSION_EXTENDED_LOOKUP.get(word)
}
